import React, {Component} from "react";
import "./CafeSearch.css";
import Search from "./Components/Search.js";

class CafeSearch extends React.Component {
  render() {
    return (
      <div>
        <div id="bar">
          <center>
            <Search onCreate={this.handleCreate} />
          </center>
        </div>

        <div>
          <CafeList />
        </div>
      </div>
    );
  }
}

class CafeList extends React.Component {
  render() {
    return (
      <div>
        <h4>"{}에 대한 검색 결과입니다."</h4>
        <table>
          <button>스타벅스 지행점</button>
          <button>스타벅스 중랑점</button>
          <button>스타벅스 노원점</button>
          <button>스타벅스 일산점</button>
          <button>스타벅스 이태원점</button>
          <button>스타벅스 홍대점</button>
          <button>스타벅스 건대점</button>
          <button>스타벅스 이태원점</button>


        </table>
      </div>
    );
  }
}

export default CafeSearch;
